pend all the money in one place.</p>',1,582,'2014-10-03 00:18:01',657,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00','','','',1,0,'','',1,5,'',0,'*',''),(190,7914,'DEV IS NO MAN ','dev-is-no-man','','<p>Few more words about me:\nI graduated from physical faculty at MSU (Moscow State University) in 2007. Since then I was working as lead analyst in Marketing research for Video International, then moved to work as a Project manager in Satellite System \"Gonets\". Up untill present time I`m working in another telecom company doing network designs for Yota LTE service provider, and some other communication-related designs. Married, have a son and expecting another child next January. If this ICO will reach a certain goal I will leave my full time job and dedicate 100% of my time to this project.</p>',1,582,'2014-10-03 00:18:01',657,'','0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00','0000-00-00 00:00:00','0000-00-00 00:00:00','','','',1,0,'','',1,8,'',0,'*',''),(191,7915,'WE THE INVESTORS SMELL SHIT CAUSED BY DEV','we-the-investors-smell-shit-caused-by-dev','','<p>WE THE INVESTORWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVWE THE INVESTORS SMELL SHIT CAUSED BY DEVW