\"created_by\":657,\"created_by_alias\":null,\"modified\":null,\"modified_by\":null,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":null,\"publish_down\":null,\"images\":null,\"urls\":null,\"attribs\":null,\"version\":null,\"ordering\":null,\"metakey\":null,\"metadesc\":null,\"access\":1,\"hits\":null,\"metadata\":null,\"featured\":null,\"language\":\"*\",\"xreference\":null}',0),(8416,192,1,'','2014-10-03 00:18:01',0,1725,'1aa05889359d8c3441453a17b1e0c18bd1577dcc','{\"id\":192,\"asset_id\":7916,\"title\":\"TRADE AT cryptsy.com\",\"alias\":\"trade-at-cryptsy-com\",\"introtext\":\"\",\"fulltext\":\"<p>\\nWhat is Cryptsy:\\n\\n\\nCryptsy is an Internet startup operated by Project Investors, Inc. focusing on the exchange of Crypto-Currency commonly known as \\u201cBitCoin\\u201d and it\'s derivatives. We currently service more than 90 different types of crypto-currency. \\n\\nThe Cryptsy.com exchange opened on May 20th, 2013 and since then has seen rapid growth in both customer base and trade volume. We currently have over 230,000 registered users with a volume of over 300k trades per day. \\n\\nCryptsy is based in Delray Beach, Florida, USA \\n\\n\\nOur Mission:\\n\\n\\nProvide a safe environment for users to trade crypto-currencies with other users in an efficient and easy to use manner. \\n\\n\\nFuture Objectives:\\n\\n\\nCryptsy will in the near future expand further by offering exchanges of fiat currency (USD) directly to crypto-currency, while also maintaining Full Compliance with global, national, and local regulations. \\n\\nCryptsy will expand its service offerings for merchants who want to easily accept BitCoin and other crypto-currency payments as an alternative payment method for their ecommerce sales. \\n\\nCryptsy will offer an escrow service for safe and direct user to user transactions. \\n<\\/p>\",\"state\":1,\"catid\":586,\"created\":\"2014-10-03 00:18:01\",\"created_by\":657,\"created_by_alias\":null,\"modified\":null,\"modified_by\":null,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":null,\"publish_down\":null,\"images\":null,\"urls\":null,\"attribs\":null,\"version\":null,\"ordering\":null,\"metakey\":null,\"metadesc\":null,\"access\":1,\"hits\":null,\"metadata\":null,\"featured\":null,\"language\":\"*\",\"xreference\":null}',0),(8417,193,1,'','2014-10-03 00:18:01',0,540,'eca3464bab6a477e6b34a2c5ebc18cca23ed5761','{\"id\":193,\"asset_id\":7917,\"title\":\"qqqqqqqqqqqqqqqq\",\"alias\":\"qqqqqqqqqqqqqqqq\",\"introtext\":\"\",\"fulltext\":\"<p>qqqqqqqqqqqqqqqqqqq<\\/p>\",\"state\":1,\"catid\":\"582\",\"created\":\"2014-10-03 00:18:01\",\"created_by\":657,\"created_by_alias\":null,\"modified\":null,\"modified_by\":null,\"checked_out\":null,\"checked_out_time\":null,\"publish_up\":null,\"publish_down\":null,\"images\":null,\"urls\":null,\"attribs\":null,\"version\":null,\"ordering\":null,\"metakey\":null,\"metadesc\":null,\"access\":1,\"hits\":null,\"metadata\":null,\"featured\":null,\"language\":\"*\",\"xreference\":null}',0);
